Ah, that could explain it :)

Our network protocol doesn't currently implement message chunking, so we cannot split up a single huge packet into multiple smaller ones. Because of this we need to put some caps on the message sizes to prevent one packet from hogging the network pipeline. I'm not sure whether 10MB was something explicitly decided on or just an arbitrary number though.

@fjl Is the 10MB protocol message limit fixed for a particular reason to 10MB, and any chance of chunking reaching devp2p? (I know you'r super busy and I bug you with a new feature every day :D)
